    <div className="bg-gray-500 py-4">
      <Link href="/Sobre">
        <a>Sobre</a>
      </Link>

      <Link href="/Cadastro">
        <a>Cadastro</a>
      </Link>

      <Link href="/Entrar">
        <a>Entrar</a>
      </Link>
    </div>
  )
};

export default NavBar;
